			<h1>Instructions</h1>
			<p>To fully activate your new templates you need to manually complete the following steps.  We do not automate most of this process in order to make sure it never becomes a target for hackers.  The following shows the test order and a brief description of what is needed to pass each test.  If you are familiar with the steps listed below click the <a class="oj" onclick="document.getElementById('tab03Title')?.click();" href="#">Setup Results</a> tab to see your results now.</p>
			<ol style="margin-left:40px">
				<li>Custodian CMS requires PHP v7.3+ and MySQL v5.5.3+ to run properly.</li>
				<li>Make a copy of the <span class="oj">/ccmspre/config_original.php</span> file and save it as <span class="oj">/ccmspre/config.php</span>.  Then update it with all your domain name and database settings.</li>
				<li>Make a copy of the <span class="oj">/ccmspre/whitelist_public_original.php</span> file and save it as <span class="oj">/ccmspre/whitelist_public.php</span>.</li>
				<li>Make a copy of the <span class="oj">/ccmspre/whitelist_user_original.php</span> file and save it as <span class="oj">/ccmspre/whitelist_user.php</span>.</li>
				<li>Import the contents of the <span class="oj">/ccms-setup-db.sql</span> file into your database manually (e.g. using PHPMyAdmin) or go to <a class="oj" onclick="document.getElementById('tab03Title')?.click();" href="#">Setup Results</a> &#187; <span class="oj">Test for database content</span> and use the "<span class="oj">Click here</span>" link to automatically do it for you.</li>
				<li>Add an administrator using the <a class="oj" onclick="document.getElementById('tab03Title')?.click();" href="#">Setup Results</a> &#187; <span class="oj">Test for Administrator</span> form if you need one.</li>
				<li><span class="oj">Rename or remove</span> the <span class="oj">/ccms-setup.php</span> file and reload this page.</li>
				<li>Optional: Add a <span class='oj'>crontask</span> to help keep the 'User' area, pasword recovery table (ccms_session) lean and clean.  We suggest setting up the <span class='oj'>crontask</span> to run at least once every two days.  <a class="oj" href="https://crontabjob.com/how-to-add-crontab-jobs-in-linux-unix/" target="_blank">How to add Crontab Jobs in Linux/Unix</a>  (Path to call: <span class='oj'>/usr/bin/php /home/your-account-name/website-folder/ccmspre/cron_session_cleanup.php</span>)</li>
